(28, '2021-07-02 12:39:06', 'tatva185@gmail.com', '[Camberwell Dragons] Your Site is Experiencing a Technical Issue', 'Howdy!\n\nSince WordPress 5.2 there is a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.\n\nIn this case, WordPress caught an error with your theme, Camberwell Dragons.\n\nFirst, visit your website (https://www.anasource.com/team4new/camberwell-dragons/) and check for any visible issues. Next, visit the page where the error was caught (https://www.anasource.com/team4new/camberwell-dragons/team4new/camberwell-dragons/wp-admin/admin-ajax.php) and check for any visible issues.\n\nPlease contact your host for assistance with investigating this issue further.\n\nIf your site appears broken and you can\'t access your dashboard normally, WordPress now has a special \"recovery mode\". This lets you safely login to your dashboard and investigate further.\n\nhttps://www.anasource.com/team4new/camberwell-dragons/wp-login.php?itsec-hb-token=camberwell-dragons-login&action=enter_recovery_mode&rm_token=RCnpSGKu1CZfVUL9dUFafD&rm_key=ggouJAnHUKuKenReMTt9er\n\nTo keep your site safe, this link will expire in 1 day. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.\n\nWhen seeking help with this issue, you may be asked for some of the following information:\nWordPress version 5.7.2\r\nCurrent theme: Camberwell Dragons (version 1.0.0)\r\nCurrent plugin:  (version )\r\nPHP version 7.2.31-1+ubuntu16.04.1+deb.sury.org+1\n\n\n\nError Details\n=============\nAn error of type E_PARSE was caused in line 100 of the file /new/team4new/camberwell-dragons/wp-content/themes/camberwell-dragons/inc/camberwell-dragons-helper-functions.php. Error message: syntax error, unexpected \'function\' (T_FUNCTION)', '', NULL),
